parts.text:
[
  {
    "id": "header-logo",
    "type": "image",
    "text": "PREFEITURA MUNICIPAL DE LIMEIRA",
    "region": "top-bar",
    "meta": {
      "alt": "Logo da Prefeitura Municipal de Limeira"
    }
  },
  {
    "id": "header-menu-button",
    "type": "button",
    "text": "Menu",
    "region": "top-bar",
    "actions": ["onClick"],
    "meta": {
      "icon": "hamburger"
    }
  },
  {
    "id": "dados-abertos-link",
    "type": "link",
    "text": "Dados Abertos",
    "region": "top-bar",
    "actions": ["onClick"]
  },
  {
    "id": "accessibility-increase-font",
    "type": "button",
    "text": "A+",
    "region": "top-bar",
    "actions": ["onClick"],
    "meta": {
      "icon": "font-size-increase"
    }
  },
  {
    "id": "accessibility-decrease-font",
    "type": "button",
    "text": "A-",
    "region": "top-bar",
    "actions": ["onClick"],
    "meta": {
      "icon": "font-size-decrease"
    }
  },
  {
    "id": "header-menu-button-2",
    "type": "button",
    "text": "Menu",
    "region": "top-bar",
    "actions": ["onClick"],
    "meta": {
      "icon": "hamburger"
    }
  },
  {
    "id": "e-transparencia-publica-button",
    "type": "button",
    "text": "e-transparência pública",
    "region": "top-bar",
    "actions": ["onClick"],
    "meta": {
      "icon": "brazil-flag"
    }
  },
  {
    "id": "conam-button",
    "type": "button",
    "text": "conam",
    "region": "top-bar",
    "actions": ["onClick"],
    "meta": {
      "icon": "conam-logo"
    }
  },
  {
    "id": "tab-lai-acesso-rapido",
    "type": "tab",
    "text": "LAI - Acesso Rápido(...)",
    "state": "inactive",
    "region": "tab-navigation",
    "actions": ["onClick"],
    "meta": {
      "closable": true
    }
  },
  {
    "id": "tab-lai-obras-novo",
    "type": "tab",
    "text": "LAI - Obras (Novo).",
    "state": "active",
    "region": "tab-navigation",
    "actions": ["onClick"],
    "meta": {
      "closable": true
    }
  },
  {
    "id": "section-title-lai-obras-novo",
    "type": "label",
    "text": "LAI - Obras (Novo).",
    "region": "main-content-header"
  },
  {
    "id": "input-obra",
    "type": "input",
    "text": "Obra",
    "placeholder": "",
    "state": "enabled",
    "region": "filter-section",
    "actions": ["onChange", "onFocus", "onBlur"]
  },
  {
    "id": "select-ano-processo",
    "type": "select",
    "text": "Ano Processo",
    "placeholder": "(Todos)",
    "state": "enabled",
    "region": "filter-section",
    "actions": ["onChange"],
    "meta": {
      "options": ["(Todos)", "2023", "2022", "2021", "2020", "2019", "2018"]
    }
  },
  {
    "id": "select-situacao",
    "type": "select",
    "text": "Situação",
    "placeholder": "(Todos)",
    "state": "open",
    "region": "filter-section",
    "actions": ["onChange"],
    "meta": {
      "options": [
        {"value": "todos", "text": "(Todos)", "state": "selected"},
        {"value": "em-execucao", "text": "EM EXECUCAO"},
        {"value": "nao-informada", "text": "(Não informada)"},
        {"value": "sem-medicao", "text": "Sem medicao"},
        {"value": "encerrado-cumprimento-integral", "text": "ENCERRADO - CUMPRIMENTO INTEGRAL"}
      ]
    }
  },
  {
    "id": "label-ultima-atualizacao",
    "type": "label",
    "text": "Última Atualização",
    "region": "filter-section"
  },
  {
    "id": "display-ultima-atualizacao",
    "type": "text-display",
    "text": "27/10/2025 23:00:39",
    "region": "filter-section",
    "meta": {
      "format": "datetime"
    }
  },
  {
    "id": "button-filtrar",
    "type": "button",
    "text": "Filtrar",
    "state": "enabled",
    "region": "filter-section",
    "actions": ["onClick"],
    "meta": {
      "icon": "filter"
    }
  },
  {
    "id": "chart-section-title",
    "type": "label",
    "text": "Situação",
    "region": "chart-section"
  },
  {
    "id": "chart-section-menu-button",
    "type": "button",
    "text": "Menu",
    "region": "chart-section",
    "actions": ["onClick"],
    "meta": {
      "icon": "hamburger"
    }
  },
  {
    "id": "pie-chart-situacao",
    "type": "chart",
    "text": "Gráfico de Situação",
    "region": "chart-section",
    "meta": {
      "chartType": "pie",
      "data": [
        {"label": "(Não informada)", "value": "unknown"},
        {"label": "EM EXECUCAO", "value": "executing"},
        {"label": "Sem medicao", "value": "no-measurement"},
        {"label": "ENCERRADO - CUMPRIMENTO INTEGRAL", "value": "closed-full-compliance"}
      ]
    }
  },
  {
    "id": "accessibility-libras-icon",
    "type": "icon",
    "text": "Libras",
    "region": "main-content",
    "actions": ["onClick"],
    "meta": {
      "icon": "hands-libras",
      "description": "Ícone de acessibilidade para Libras"
    }
  },
  {
    "id": "table-obras-title",
    "type": "label",
    "text": "Obras",
    "region": "table-section"
  },
  {
    "id": "table-obras-menu-button",
    "type": "button",
    "text": "Menu",
    "region": "table-section",
    "actions": ["onClick"],
    "meta": {
      "icon": "hamburger"
    }
  },
  {
    "id": "table-obras",
    "type": "table",
    "text": "Tabela de Obras",
    "region": "table-section",
    "meta": {
      "headers": [
        {"id": "nro-processo", "text": "Nro Processo"},
        {"id": "ano", "text": "Ano"},
        {"id": "situacao", "text": "Situação"},
        {"id": "obra", "text": "Obra"}
      ],
      "rows": [
        {"nro-processo": {"type": "link", "text": "C00001"}, "ano": "2018", "situacao": "ENCERRADO - CUMPRIMENTO INTEGRAL", "obra": {"type": "link", "text": "Sem descricao'"}},
        {"nro-processo": {"type": "link", "text": "C00001"}, "ano": "2019", "situacao": "EM EXECUCAO", "obra": {"type": "link", "text": "Sem descricao'"}},
        {"nro-processo": {"type": "link", "text": "C00001"}, "ano": "2020", "situacao": "ENCERRADO - CUMPRIMENTO INTEGRAL", "obra": {"type": "link", "text": "Sem descricao'"}},
        {"nro-processo": {"type": "link", "text": "C00001"}, "ano": "2021", "situacao": "ENCERRADO - CUMPRIMENTO INTEGRAL", "obra": {"type": "link", "text": "Sem descricao'"}},
        {"nro-processo": {"type": "link", "text": "C00001"}, "ano": "2022", "situacao": "(Não informada)", "obra": {"type": "link", "text": "Sem descricao'"}},
        {"nro-processo": {"type": "link", "text": "C00001"}, "ano": "2023", "situacao": "(Não informada)", "obra": {"type": "link", "text": "Sem descricao'"}},
        {"nro-processo": {"type": "link", "text": "C00002"}, "ano": "2018", "situacao": "ENCERRADO - CUMPRIMENTO INTEGRAL", "obra": {"type": "link", "text": "Sem descricao'"}},
        {"nro-processo": {"type": "link", "text": "C00002"}, "ano": "2019", "situacao": "ENCERRADO - CUMPRIMENTO INTEGRAL", "obra": {"type": "link", "text": "Sem descricao'"}}
      ]
    }
  },
  {
    "id": "detail-section-title",
    "type": "label",
    "text": "Detalhe",
    "region": "detail-section"
  },
  {
    "id": "detail-section-menu-button",
    "type": "button",
    "text": "Menu",
    "region": "detail-section",
    "actions": ["onClick"],
    "meta": {
      "icon": "hamburger"
    }
  },
  {
    "id": "detail-placeholder-text",
    "type": "text-display",
    "text": "Selecione um processo Licitatório",
    "region": "detail-section",
    "state": "empty"
  }
]
